  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is the topographic elevation
  point data derived from multiple return light detection and ranging (LiDAR) measurements
  for seven counties in Georgia. These counties are: Bibb, Harris, Heard, Jasper,
  Jones, Monroe, and Walton. The Statement of Work (SOW) was developed by the National
  Oceanic and Atmospheric Administration's (NOAA) Office for Coastal Management (referred
  to as the Center) in partnership with the Georgia Department of Natural Resources
  (GADNR) Environmental Protection Division (EPD). The data included hydro flattened
  DEMs for inclusion into the National Elevation Dataset (NED). LiDAR was collected
  as weather permitted between March 2 and April 14, 2011. In all, a total of 2570
  square miles were collected in 390 flightlines. The data were collected at 1.0 point
  per square meter (1.0 m GSD) for the seven \"inland\" counties in Georgia. This
  area was flown during snow free and leaf-off conditions. The data contains las points
  with the following classifications: Class -1 No Classification Class 2 Ground Class
  7 Low Point (Noise) Class 9 Water Class 10 Land below sea level Class 12 Overlap\",\n\t\"license_title\":
